import styled from 'styled-components/macro'

export const TabContainer = styled.section`
    width:100%;
    display: block;
    margin:3em 0;
    border-radius: 5px;
    border: 1px solid #aaa;
    box-shadow: 2px 2px 13px -1px rgba(0, 0, 0, 0.75);

`
